// Extract all PNR IDs and Store it as an Array
// @Author - Kabul Grover

def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context );
def holder = groovyUtils.getXmlHolder( "GT_ERP_TravelItineraryLocatorReadRQ#Response" );

// define namepace's
holder.namespaces['xmlns'] = "http://services.sabre.com/ns/getthere";
holder.namespaces['soap-env'] = "http://schemas.xmlsoap.org/soap/envelope/";

// loop item nodes in response message
arr = [] // Intial Array
for( item in holder.getNodeValues( "//xmlns:ItineraryRef/@ID" ))
	arr << item;

count = holder.getNodeValues( "//xmlns:LocatorCount/@Count" )[0];
nextTime = holder.getNodeValues( "//xmlns:NextStartTime/@UtcTime" )[0];

log.info "Extracted PNRs: " + arr
log.info "Extracted PNRs Size: " + arr.size()
log.info "Extracted PNRs Count: " + count
log.info "Next Start Time: " + nextTime
assert arr.size() != count

//Trick: Count Change
count = count.toInteger() - 1;

// Set project variables
testRunner.testCase.testSuite.project.setPropertyValue("PNRIDs",arr.join(','));
testRunner.testCase.testSuite.project.setPropertyValue("PNRCount",''+count);
