// Parse Previous Response and Perform validations

def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context );
def holder = groovyUtils.getXmlHolder( "GT_ERP_TravelItineraryReadRQ#Response" );

// define namepace's
holder.namespaces['xmlns'] = "http://services.sabre.com/ns/getthere";
holder.namespaces['soap-env'] = "http://schemas.xmlsoap.org/soap/envelope/";


//log.info holder.getXml()

//domObj = holder.getDomNode("//xmlns:ReservationItems");
//log.info domObj.getChildNodes()
//log.info domObj.hasChildNodes() 


pnrCode = holder.getNodeValue("//xmlns:ItineraryRef/@ID");
tripID = holder.getNodeValue("//xmlns:GetthereTripID/@TripID");
ticketTimeLimit = holder.getNodeValue("//xmlns:Ticketing/@TicketTimeLimit");
updatedBy = holder.getNodeValue("//xmlns:UpdatedBy/@CreateDateTime");
itineraryStatus = holder.getNodeValue("//xmlns:ItineraryStatus/@Status");


counter = testRunner.testCase.testSuite.project.getPropertyValue("counter");
status = holder.getNodeValue("//xmlns:ItineraryStatus/@Status");

//log.info "Counter: " + counter + " PNRCode: " + pnrCode + " Status: " + status;

log.info "PNRCode: " + pnrCode + " TripID: " + tripID + " TicketingTimeLimit: " + ticketTimeLimit +" UpdatedBy: " + updatedBy + " ItineraryStatus: " + itineraryStatus; 
def lineToWrite = pnrCode + "," + tripID + "," + ticketTimeLimit + "," + updatedBy + "," + itineraryStatus + "\n"; 


// Create FIle

//def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context);
def projectDir = groovyUtils.projectPath;


def directory = '/GetThereFiles/';
def file = testRunner.testCase.testSuite.project.getPropertyValue("NextStartTime") +'\\' + testRunner.testCase.testSuite.project.getPropertyValue("NextStartTime") + '.csv';
String path = projectDir + directory + file;
log.info path;

fos = new FileOutputStream( path, true )
pw = new PrintWriter( fos )
pw.write(lineToWrite);
//lineToWrite.writeTo( pw )
pw.close()
fos.close()

