	log.info "Counter: " + counter + " PNR: " + uniqueID;
	testRunner.testCase.testSuite.project.setPropertyValue("UniqueID",uniqueID);
	testRunner.testCase.testSuite.project.setPropertyValue("counter",''+counter);
